window.bookSummaryJSON = "<p>Tattooed on my skin are the words, “Bow to no man.”</p> <p>I live by them.</p> <p>Die by them.</p> <p>I’ve been on the run since my mother was killed right in front of me, hiding in the gritty underbelly of New Orleans. After a lifetime of being alone, the only thing I crave is revenge.</p> <p>But I never anticipated Lincoln Asher.</p> <p>From the moment we meet under a starless night sky, Lincoln looks at me like I’m already his.</p> <p>He’s scarred and hard all over, but hot as sin when he holds my gaze.</p> <p>I don’t trust anyone, least of all him.</p> <p>He’s a wolf in sheep’s clothing, I just know it, but that doesn’t lessen the temptation of surrender.</p> <p>I bow to no man, save one.</p> <p>And he will be my downfall...</p> <p>Sworn is a dark age gap romance featuring morally grey characters, unhinged villains, and enough spice to light your kindle on fire. Lincoln and Avery's story concludes in Defied, which is now available.</p>"; 
